import { Link } from "react-router-dom";
import classes from "./UkrainianNavigation.module.css";
import TransitionAnimation from "./TransitionAnimation.tsx";
import UkrainianMainPage from "../pages/UkrainianMainPage";
import ProNas from "../pages/ProNas";
function UkrainianNavigation() {
  return (
    <nav className={classes.navigation}>
      <TransitionAnimation>
        <Link className={classes.link} to="/proNas" params={{currentPage:<UkrainianMainPage/>,nextPage:<ProNas/>}}>
          Про нас
        </Link>
      </TransitionAnimation>
      <Link className={classes.link} to="">
        Номера та ціни
      </Link>
      <Link className={classes.link} to="">
        Галерея
      </Link>
      <Link className={classes.link} to="">
        Контакти
      </Link>
    </nav>
  );
}
export default UkrainianNavigation;
